{'code': 'import pandas as pd
import numpy as np
from scipy import stats

def run_statistical_tests():
    df = df_features if 'df_features' in globals() and df_features is not None else \
         (df_clean if 'df_clean' in globals() and df_clean is not None else \
          (df_raw if 'df_raw' in globals() and df_raw is not None else None))

    if df is None:
        print("No DataFrame available (df_raw, df_clean, or df_features).")
        return

    print("Available columns:", df.columns.tolist())

    num_cols = df.select_dtypes(include=[np.number]).columns.tolist()
    cat_cols = df.select_dtypes(include=['object', 'category']).columns.tolist()

    print(f"Numeric columns found: {num_cols}")
    print(f"Categorical columns found: {cat_cols}")

    # Test 1: Normality test on first numeric column
    if len(num_cols) >= 1:
        col = num_cols[0]
        if col in df.columns:
            try:
                # Shapiro-Wilk test is sensitive to sample size, limit to 5000 for performance and applicability
                sample = df[col].dropna().sample(min(len(df[col].dropna()), 5000), random_state=42) if len(df[col].dropna()) > 5000 else df[col].dropna()
                if len(sample) >= 3: # Shapiro test requires at least 3 data points
                    stat, p = stats.shapiro(sample)
                    print(f'Normality Test ({col}): p-value = {p:.4f}')
                else:
                    print(f'Normality Test ({col}): Not enough data points (n={len(sample)}) for Shapiro-Wilk test.')
            except Exception as e:
                print(f'Error performing Normality Test on {col}: {e}')
        else:
            print(f"Column '{col}' not found for Normality Test.")
    else:
        print('No numeric columns available for Normality Test.')

    # Test 2: Correlation test between first two numeric columns
    if len(num_cols) >= 2:
        col1, col2 = num_cols[0], num_cols[1]
        if col1 in df.columns and col2 in df.columns:
            try:
                # Drop NA values for both columns for Pearson correlation
                combined_df = df[[col1, col2]].dropna()
                if len(combined_df) > 1: # Pearson correlation requires at least 2 data points
                    r, p = stats.pearsonr(combined_df[col1], combined_df[col2])
                    print(f'Correlation Test ({col1} vs {col2}): r={r:.4f}, p-value={p:.4f}')
                else:
                    print(f'Correlation Test ({col1} vs {col2}): Not enough common data points (n={len(combined_df)}) after dropping NA.')
            except Exception as e:
                print(f'Error performing Correlation Test on {col1} and {col2}: {e}')
        else:
            print(f"One or both columns ('{col1}', '{col2}') not found for Correlation Test.")
    else:
        print('Not enough numeric columns available for Correlation Test.')

    # Test 3: Group comparison if categorical column exists
    if len(cat_cols) >= 1 and len(num_cols) >= 1:
        cat_col, num_col = cat_cols[0], num_cols[0]
        if cat_col in df.columns and num_col in df.columns:
            try:
                groups = [group[num_col].dropna() for name, group in df.groupby(cat_col)]
                valid_groups = [g for g in groups if len(g) >= 2] # Kruskal-Wallis requires at least 2 data points per group

                if len(valid_groups) >= 2: # Kruskal-Wallis requires at least 2 groups
                    # Limit to 5 groups for Kruskal-Wallis if there are many to avoid computational issues or misinterpretation
                    stat, p = stats.kruskal(*valid_groups[:5])  
                    print(f'Group Comparison ({num_col} by {cat_col}): p-value = {p:.4f}')
                else:
                    print(f'Group Comparison ({num_col} by {cat_col}): Not enough valid groups (found {len(valid_groups)}) for Kruskal-Wallis test.')
            except Exception as e:
                print(f'Error performing Group Comparison on {num_col} by {cat_col}: {e}')
        else:
            print(f"One or both columns ('{num_col}', '{cat_col}') not found for Group Comparison.")
    else:
        print('Not enough categorical or numeric columns available for Group Comparison.')

run_statistical_tests()'}

